import React from 'react'
import ReactDOM from 'react-dom'


export default class Graph extends React.Component {
    constructor(props) {
      super(props);
      this.state = {emotion: ""};
    }

    componentDidMount() {
        var bearer = 'Bearer '+ sessionStorage.getItem("authToken");        ;
        fetch('http://localhost:5000/api/Emotions', {
            method: 'GET',
            withCredentials: true,
            credentials: 'include',
            headers: {
                'Authorization': bearer,
                'Content-Type': 'application/json'}
            })
        .then((res) => res.json())
        .then(json => {
          console.log(json)
          ReactDOM.render(
            <div>Registered : {json.status}</div>,
            document.getElementById('root')
          );
        })
    }

    render() {
      return (
        <div>
          <h1>Hello, world!</h1>
        </div>
      );
    }
  }
